 // Add local audio track for microphone input in the browser\\n  const ms = await navigator.mediaDevices.getUserMedia({\\n    audio: true\\n  });\\n  pc.addTrack(ms.getTracks()[0]);\\n\\n  // Set up data channel for sending and receiving events\\n  const dc = pc.createDataChannel(\\"oai-events\\");\\n  dc.addEventListener(\\"message\\", (e) => {\\n    // Realtime server events appear here!\\n    console.log(e);\\n  });\\n\\n  // Start the session using the Session Description Protocol (SDP)\\n  const offer = await pc.createOffer();\\n  await pc.setLocalDescription(offer);\\n\\n  const baseUrl = \\"https://api.openai.com/v1/realtime\\";\\n  debugger;\\n  const sdpResponse = await window.fetch.bind(window)(`${baseUrl}?model=${model}`, {\\n    method: \\"POST\\",\\n    body: offer.sdp,\\n    headers: {\\n      Authorization: `Bearer ${EPHEMERAL_KEY}`,\\n      \\"Content-Type\\": \\"application/sdp\\"\\n    },\\n  });\\n\\n  const answer = {\\n    type: \\"answer\\",\\n    sdp: await sdpResponse.text(),\\n  };\\n  await pc.setRemoteDescription(answer);\\n}\\n\\ninit();\\n```"},{"tagName":"dochash","text":"actions/ai"},{"tagName":"docname","text":"ai.openai.createRealtimeSession"}]},"group":null},{"id":1381,"order":9999,"name":"ai.sloyd.generateModel","reflection":{"id":1381,"name":"__type","variant":"signature","kind":4096,"flags":{},"comment":{"summary":[{"kind":"text","text":"Generates a new 3D model using [sloyd.ai](https://www.sloyd.ai/)."}],"blockTags":[{"tag":"@example","content":[{"kind":"code","text":"```ts\\nGenerate a chair model using Sloyd\\nconst model = await ai.sloyd.generateModel({\\n    prompt: \'a chair\'\\n});\\n```"}]},{"tag":"@example","content":[{"kind":"code","text":"```ts\\nGenerate a chair using a studio subscription\\nconst model = await ai.sloyd.generateModel({\\n    recordName: \'studioID\',\\n    prompt: \'a chair\'\\n});\\n```"}]},{"tag":"@dochash","content":[{"kind":"text","text":"actions/ai"}]},{"tag":"@docname","content":[{"kind":"text"